import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import AdminDashboard from './dashboards/AdminDashboard';
import TeacherDashboard from './dashboards/TeacherDashboard';
import StudentDashboard from './dashboards/StudentDashboard';
import ParentDashboard from './dashboards/ParentDashboard';
import './App.css';

function App() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  // Load user from storage on initial boot
  useEffect(() => {
    try {
      const storedUser = localStorage.getItem('user');
      if (storedUser) {
        const parsedUser = JSON.parse(storedUser);
        parsedUser.role = parsedUser.role?.toLowerCase(); // normalize role
        setUser(parsedUser);
      }
    } catch (error) {
      console.error("Failed to parse stored user:", error);
      localStorage.clear();
    } finally {
      setLoading(false);
    }
  }, []);

  const handleLogin = (userData) => {
    const normalizedUser = {
      ...userData,
      role: userData.role?.toLowerCase(),
    };

    setUser(normalizedUser);
    localStorage.setItem('user', JSON.stringify(normalizedUser));

    if (userData.token) {
      localStorage.setItem('token', userData.token);
    }
  };

  const handleLogout = () => {
    setUser(null);
    localStorage.clear();
  };

  // Decide dashboard by role
  const getDashboardByRole = (userRole) => {
    switch (userRole) {
      case 'admin': return <AdminDashboard user={user} onLogout={handleLogout} />;
      case 'teacher': return <TeacherDashboard user={user} onLogout={handleLogout} />;
      case 'student': return <StudentDashboard user={user} onLogout={handleLogout} />;
      case 'parent': return <ParentDashboard user={user} onLogout={handleLogout} />;
      default:
        return (
          <div className="error-container">
            <h2>Unauthorized Role</h2>
            <button onClick={handleLogout}>Return to Login</button>
          </div>
        );
    }
  };

  if (loading) {
    return <div className="app-loader">Initializing System...</div>;
  }

  return (
    <Routes>
      {/* Login */}
      <Route
        path="/login"
        element={!user ? <Login onLogin={handleLogin} /> : <Navigate to="/dashboard" replace />}
      />

      {/* Dashboard */}
      <Route
        path="/dashboard/*"
        element={user ? getDashboardByRole(user.role) : <Navigate to="/login" replace />}
      />

      {/* Root redirect */}
      <Route path="/" element={<Navigate to={user ? "/dashboard" : "/login"} replace />} />

      {/* Catch-all */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}

export default App;


